import React from "react"

export default function Hero(props){
    return(
        <div className="hero-container">
            <div className="hero-img">
                <img src={props.img}/>
            </div>
            <div className="hero-title">
                <h2>
                    {props.title}
                </h2>
            </div>
            <div className="hero-about">
            <h2>
                about: {props.about}
            </h2>
            </div>
        </div>
    )
}
